INSERT INTO `Post` VALUES ('54003c02-0828-4fa1-bd30-523bfc17c0f7','Plan City Adventures from a Surry Hills Balcony','Surry Hills','Surry Hills New South Wales, Australia','ChIJW7w1-SGuEmsRkMwyFmh9AQU','(-33.886111, 151.21111099999996)','Apartment & Unit','2 People,1 Bedroom,1 Bed,1 Bathroom,','Wireless Internet,Free parking,Washer,Dryer,Hair dryer,Bathroom essentials,Bedroom comforts,Pool,Dishwasher,Coffee maker,Full kitchen,',NULL,'Unwind in the leafy courtyard of this extraordinary Surry Hills home. Classic aesthetics blend with eccentric vintage charm and decor. Watch the city from the balcony, or venture out from the doorstep as most hot spots are only a short walk away.\r\n\r\nThis is undoubtedly the best location is Surry Hills, two minutes\' walk to cafes, restaurants, and bars and a short walk to the CBD, Sports Fields, Centennial Park, Opera House, and Sydney Harbour. Take a short trip to Bondi or Manly Beach.',140,'false','2018-10-01 00:00:00','2019-10-01 00:00:00','2018-10-08 01:32:40',0,1,NULL,'2018-10-12 00:15:35',1),('9ef4c63e-3045-4d36-9d99-540e156c136a','$185 per week, very close to Woolworths and bus stops','Eastlakes','3/17 Mascot Drive, Eastlakes NSW, Australia','EiszLzE3IE1hc2NvdCBEcml2ZSwgRWFzdGxha2VzIE5TVywgQXVzdHJhbGlhIjASLgoUChIJwTdw66GxEmsRmyT90NUR8xAQESoUChIJP1TJVZ-xEmsRLfm_44hSMSA','(-33.92617540000001, 151.20956750000005)','Apartment & Unit','2 People,1 Bedroom,','Wireless Internet,Dryer,',NULL,'Free Tram Zone\r\n\r\nParliament Train Station 120 m from front door\r\n\r\n\r\nRent includes;\r\n\r\n\r\nFully equipped kitchen\r\n\r\nAll homewares\r\n\r\nPrivate bathroom\r\n\r\nUtilities connection and ongoing usage charges (electricity, water & gas)\r\n\r\nLCD television\r\n\r\nHeating and cooling\r\n\r\nLaundry\r\n\r\n\r\nUnlimited wi-fi is an additional $22 per week\r\n\r\nSecure basement Car park - direct elevator access - $70 per week\r\n\r\nHousekeeping service available - $120 per service\r\n\r\nThere is a once of exit clean fee of $250\r\n\r\nBond $2,500\r\n\r\n\r\nRent is paid every second Friday in advance\r\n\r\n\r\nBedding configuration either a King, or two single beds depending on your requirements.\r\n\r\n\r\n150m to Parliament Train station\r\n\r\n100m to Collins St No 8 Tram Stop (Numbers 11, 12, 48, 109 Trams)\r\n\r\n50m to Fitzroy Gardens\r\n\r\n900m to Yarra River and Melbourne Sporting Precinct',89,'false','2018-10-10 00:00:00','2018-11-10 00:00:00','2018-10-07 20:46:35',1,2,NULL,'2018-10-07 20:46:35',1),('9efe734b-7fe3-40f9-89e7-2d749f6407d9','Darlinghurst Studio: Sky Oasis','Darlinghurst','Darlinghurst New South Wales, Australia','ChIJ7bV1-XuuEmsR8LMyFmh9AQU','(-33.8780176, 151.2204441)','Apartment & Unit','2 People,1 Bedroom,1 Bed,1 Bathroom,','Wireless Internet,Free parking,Washer,Dryer,Hair dryer,Bathroom essentials,Bedroom comforts,Dishwasher,Full kitchen,',NULL,'Decidedly cool. Chill out in this bright & beautiful Darlinghurst Studio, right in the heart of the best of Victoria St cafe\'s, back street art galleries, theatres plus chic eateries on Stanley St. Live in Art Deco history with best view in town!\r\n\r\nMore information\r\nThe space\r\n\r\nNEWLY RETILED BATHROOM AND ENTIRE STUDIO PAINTED :-)\r\n\r\nEntire home, not shared.\r\n\r\nLast minute bookings cannot be accepted after 4pm same day and we also need 2hrs notice to organise cleaners.\r\n\r\nThis top floor apartment (5th floor, accessible via lift or stairs) with very high ceilings and 1920s heritage art deco features is a space that is full of light all day long with an incredible vista day or night.\r\n\r\nDon\'t stay here if you don\'t love character with an oldy worldy Parisian loft feel as this studio is filled to the brim with character and charm for those who love original details. Included in the old world charm are old world building sounds like a distant clunking sound when the lift is operated. Older buildings were built so well and the thick walls mean no neighbour sounds, the culdesac street means no traffic noises whilst right in the heart of the restaurant filled village.\r\n\r\nBrilliant for a single or couple, sleeping maximum two people, on the chiropractic, comfortable queen bed.\r\n\r\nThe kitchen is separate to the main living space, in a small galley way, with a full sized fridge, gas stove (no microwave or oven). No need to sleep with the kitchen in this studio!\r\n\r\nThe kitchen and bathroom both have stunning original tiles with a huge beautiful deep bath, so if you\'re a bath person, you will be in heaven, enjoying the lovely cross breeze (no AC but none needed!) after a day of walking around the sites of Sydney.',129,'false','2018-09-03 00:00:00','2019-08-09 00:00:00','2018-10-11 20:03:58',0,3,NULL,'2018-10-11 20:03:58',1),('d294159e-e6dd-4357-ba9d-ee038f79b0c2','Stunning Bright Studio with Leafy Courtyard','Alexandria','Alexandria New South Wales, Australia','ChIJa0nQNrSxEmsRMKsyFmh9AQU','(-33.90166, 151.20006999999998)','Townhouse & Villa','2 People,1 Bedroom,1 Bed,1 Bathroom,','Wireless Internet,Free parking,Washer,Dryer,Hair dryer,Bathroom essentials,Bedroom comforts,Dishwasher,Full kitchen,',NULL,'Fire up the barbecue for a delicious meal in the evening in the colourful, verdant courtyard. This bright studio is cosy and well-appointed, making intelligent use of the space. It boasts contemporary furnishings with splashes of colour.\r\n\r\nIt is in leafy Alexandria, with great local cafes, trendy bars, and restaurants. Sydney Park is a 10-minute walk away. It is close to buses and trains to the CBD, Circular Quay, and beaches.',120,'false','2018-10-20 00:00:00','2019-08-22 00:00:00','2018-10-08 16:11:35',1,2,NULL,'2018-10-08 16:11:35',1),('e36ebf47-945f-48ba-833f-24b97bac478b','Converted Warehouse Loft with Balcony Bar','Chippendale','Chippendale New South Wales, Australia','ChIJmX02FgWuEmsRILEyFmh9AQU','(-33.8863, 151.19990000000007)','Apartment & Unit','2 People,1 Bedroom,1 Bed,1 Bathroom,','Wireless Internet,Free parking,Washer,Dryer,Hair dryer,Bathroom essentials,Bedroom comforts,',NULL,'An architectural triumph, this enchanting loft boasts high ceilings, exposed beams and a clever split-level design which maximises living spaces. A podium-style lounge room enjoys uninterrupted elevated views, and opens onto a large private terrace.',135,'false','2018-10-02 00:00:00','2018-10-26 00:00:00','2018-10-08 01:25:42',1,1,NULL,'2018-10-08 01:51:24',1),('f65b37a2-04be-496c-96cf-72b9afcbf244','Self Contained Cottage Leichhardt!','Leichhardt','Leichhardt NSW, Australia','ChIJcXTalRuwEmsR0L0yFmh9AQU','(-33.8847, 151.15729999999996)','Townhouse & Villa','2 People,1 Bedroom,2 Beds,1 Bathroom,','Wireless Internet,Free parking,Dryer,Hair dryer,Bathroom essentials,',NULL,'Our little cottage hidden away in Sydney\'s inner west is ideal for 2 adults. Private and cosy with your own ensuite, enjoy a comfy double bed, big screen TV, video/DVD player with a selection of movies plus a kitchenette with bar fridge & microwave.\r\n\r\nMore information\r\nThe space\r\n\r\nThis small cottage is private and cosy, separate to the main house and ideally suited to 2 adults. Enjoy the snuggly double bed, your own ensuite, the big comfy lounge and big screen TV along with lots of DVD\'s & videos for that night in with a bottle of red! Tea and coffee making facilities are available along with a microwave and bar fridge. If you would like an early check-in or late check-out just ask! We will certainly do our best to accommodate your request!\r\n\r\nGuest access\r\n\r\nThe cottage is at the end of our garden. Your access is via a private and secure side gate alongside our home so you can come and go as you please. Parking is also freely available in our street if you have a car.\r\n\r\nInteraction with guests\r\n\r\nWe both work fulltime so we may not see you very often. However if you need anything at all we are either just a door knock or phone call away.',100,'false','2018-10-12 00:00:00','2019-10-12 00:00:00','2018-10-12 00:10:00',0,6,NULL,'2018-10-12 00:10:00',1);
